import React from 'react'
import { SingUp,Header,HeaderIniciarSesion} from '../../Components'
import Container from 'react-bootstrap/Container'
const IniciarSesion = () => {
    return (
        <>
            <Header />
            <HeaderIniciarSesion />
            <SingUp className="fondo"/>
        </>
    )
}

export default IniciarSesion
